import React from 'react';
import UHeader from './UHeader.js'
import Footer from './Footer.js'

import { 
  // Switch,
  // Route,
  Link,
  // HashRouter
} from 'react-router-dom';
// import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
// import NavItem from 'react-bootstrap/NavItem';
// import Home from './Home.js'
// import CreateAccount from './CreateAccount.js'
// import NotFound from './NotFound'
// import ULogo from './ULogo.js'
import UButton from './UButton';
// import './../style/UNavStyle.css'

export default class Main extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      selections: [
        <Nav.Link key="1" as={Link} to="/"><UButton variant="u-white" content="Home" /></Nav.Link>,
        <Nav.Link key="2" as={Link} to="/create_account"><UButton variant="u-action" content="Sign Up" /></Nav.Link>
      ]
    }
  }

  updateNavBar () {
    console.log("update")

    this.setState({selections: []})
  }

  render() {
    return (
      <div style={{backgroundColor: '#f8f9fa'}}>
        <UHeader updateNavBar={() => this.updateNavBar()} selections={this.state.selections} />
        {/* Content is dynamically added based on the url */}
        <Footer />
      </div>
    )
  }
}
